import React from "react";

function App() {
  return (
    <div className="container">
      <h1>Hello</h1>
      <form>
        <input
          type="text"
          placeholder="What's your name?"
        />
        <input
          type="text"
          placeholder="What's your name?"
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
